import React from 'react'
import './header.css'

function Header(props) {
  return (
    <div className='header'>
      <h2>
        X: {props.wins.xWin}
        </h2>
      <h2>
        Turn : {props.turn}
        </h2>
      <h2>
        O: {props.wins.oWin+1}
        </h2>
    </div>
  )
}

export default Header
